    40→    /**
    41→     * Consultar antecedentes en API externa (TusDatos).
    42→     *
    43→     * @param Request $request Contenido de la petición.
    44→     * @throws Exception
    45→     * @return array
    46→     * @author Andres González
    47→     */
    48→    public function consultarAntecedentes(Request $request): array {
    49→        $empresa = $this->empresa_usuario_repositorio->obtenerEmpresaActualUsuario();
    50→        $forzar  = $request->has('forzar') && filter_var($request->forzar, FILTER_VALIDATE_BOOLEAN);
    51→
    52→        $validacion_creacion = $this->validacionCreacion($request, $empresa, $forzar);
    53→
    54→        if ($validacion_creacion['retornar']) {
    55→            return $validacion_creacion['respuesta'];
    56→        }
    57→        $antecedente = $validacion_creacion['antecedente'];
    58→
    59→        $llamada_api = $this->llamadaApi($request, $antecedente, $forzar);
    60→
    61→        if ($llamada_api['retornar']) {
    62→            return $llamada_api['respuesta'];
    63→        }
    64→        $respuesta_api = $llamada_api['datos_api'];
    65→
    66→        return $this->guardarRespuesta($antecedente, $respuesta_api);
    67→    }
