    69→    /**
    70→     * Validar consulta existente y crear antecedente inicial.
    71→     *
    72→     * @param Request $request Contenido de la petición.
    73→     * @param mixed $empresa Empresa actual.
    74→     * @param bool $forzar Forzar nueva consulta.
    75→     * @return array
    76→     * @author Andres González
    77→     */
    78→    private function validacionCreacion(Request $request, $empresa, bool $forzar): array {
    79→        try {
    80→            if (!$forzar) {
    81→                $consulta_existente = $this->repositorio->buscarConsultaReciente($request->documento, $request->tipo_documento ?? 'CC', 15);
    82→
    83→                if ($consulta_existente) {
    84→                    return [
    85→                        'retornar'  => true,
    86→                        'respuesta' => [
    87→                            'codigo'  => 200,
    88→                            'existe'  => true,
    89→                            'message' => 'Ya existe una consulta reciente para este documento.',
    90→                            'data'    => $consulta_existente
    91→                        ]
    92→                    ];
    93→                }
    94→            }
    95→
    96→            DB::beginTransaction();
    97→
    98→            $consulta_activa = $this->repositorio->buscarConsultaActiva($request->documento, $request->tipo_documento ?? 'CC');
    99→
   100→            if ($consulta_activa) {
   101→                DB::rollBack();
   102→
   103→                return [
   104→                    'retornar'  => true,
   105→                    'respuesta' => [
   106→                        'codigo'  => 409,
   107→                        'message' => 'Ya existe una consulta en proceso para este documento. Por favor espere unos momentos e intente nuevamente.'
   108→                    ]
   109→                ];
   110→            }
   111→
   112→            $antecedente = $this->repositorio->crear([
   113→                'usuario_id'       => Auth::id(),
   114→                'empresa_id'       => $empresa->id,
   115→                'tipo_documento'   => $request->tipo_documento ?? 'CC',
   116→                'documento'        => $request->documento,
   117→                'fecha_expedicion' => $request->fecha_expedicion ?? null
   118→            ]);
   119→
   120→            DB::commit();
   121→
   122→            return [
   123→                'retornar'    => false,
   124→                'antecedente' => $antecedente
   125→            ];
   126→        } catch (Exception $error) {
   127→            if (DB::transactionLevel() > 0) {
   128→                DB::rollBack();
   129→            }
   130→
   131→            return [
   132→                'retornar'  => true,
   133→                'respuesta' => [
   134→                    'codigo'  => 500,
   135→                    'message' => 'Error en validación inicial: ' . $error->getMessage()
   136→                ]
   137→            ];
   138→        }
   139→    }
