   141→    /**
   142→     * Llamar API externa de TusDatos.
   143→     *
   144→     * @param Request $request Contenido de la petición.
   145→     * @param mixed $antecedente Antecedente creado.
   146→     * @param bool $forzar Forzar nueva consulta.
   147→     * @return array
   148→     * @author Andres González
   149→     */
   150→    private function llamadaApi(Request $request, $antecedente, bool $forzar): array {
   151→        try {
   152→            $this->repositorio->actualizar($antecedente->id, [
   153→                'estado' => 'solicitando'
   154→            ]);
   155→
   156→            $tipo_documento_texto = $request->tipo_documento ?? 'CC';
   157→            $fecha_expedicion     = $request->has('fecha_expedicion') && $request->fecha_expedicion !== null
   158→                ? Carbon::parse($request->fecha_expedicion)->format('d/m/Y')
   159→                : null;
   160→
   161→            $respuesta_api = $this->tus_datos_servicio->lanzarConsulta(
   162→                $request->documento,
   163→                $tipo_documento_texto,
   164→                $fecha_expedicion,
   165→                $request->nombre ?? null,
   166→                $forzar,
   167→                "consulta-psy2-{$antecedente->id}"
   168→            );
   169→
   170→            if (isset($respuesta_api['validado']) && !$respuesta_api['validado']) {
   171→                $tiene_trabajo_id = isset($respuesta_api['jobid']) && !empty($respuesta_api['jobid']);
   172→                $tiene_resultado  = isset($respuesta_api['id']) && !empty($respuesta_api['id']);
   173→
   174→                if (!$tiene_trabajo_id && !$tiene_resultado) {
   175→                    $mensaje_error = $respuesta_api['error'] ?? $respuesta_api['mensaje']
   176→                                   ?? $respuesta_api['message'] ?? 'Los datos proporcionados no son válidos';
   177→
   178→                    throw new Exception($mensaje_error, 400);
   179→                }
   180→            }
   181→
   182→            return [
   183→                'retornar'  => false,
   184→                'datos_api' => $respuesta_api
   185→            ];
   186→        } catch (GuzzleException $error) {
   187→            $this->repositorio->actualizar($antecedente->id, [
   188→                'estado'  => 'api_error',
   189→                'errores' => 'Error de red: ' . $error->getMessage()
   190→            ]);
   191→
   192→            return [
   193→                'retornar'  => true,
   194→                'respuesta' => [
   195→                    'codigo'  => 503,
   196→                    'message' => 'Error al contactar el servicio externo. Por favor intente más tarde.'
   197→                ]
   198→            ];
   199→        } catch (Exception $error) {
   200→            $this->repositorio->actualizar($antecedente->id, [
   201→                'estado'  => 'api_rejected',
   202→                'errores' => $error->getMessage()
   203→            ]);
   204→
   205→            return [
   206→                'retornar'  => true,
   207→                'respuesta' => [
   208→                    'codigo'  => $error->getCode() ?: 400,
   209→                    'message' => $error->getMessage()
   210→                ]
   211→            ];
   212→        }
   213→    }
   214→
   215→    /**
   216→     * Guardar respuesta de API en base de datos.
   217→     *
   218→     * @param mixed $antecedente Antecedente a actualizar.
   219→     * @param array $respuesta_api Respuesta de la API.
   220→     * @return array
   221→     * @author Andres González
   222→     */
   223→    private function guardarRespuesta($antecedente, array $respuesta_api): array {
   224→        try {
   225→            DB::beginTransaction();
   226→
   227→            $datos_actualizacion = [
   228→                'nombre' => isset($respuesta_api['nombre']) && !empty($respuesta_api['nombre'])
   229→                    ? $respuesta_api['nombre']
   230→                    : 'No identificado'
   231→            ];
   232→
   233→            if (isset($respuesta_api['jobid'])) {
   234→                $datos_actualizacion['trabajo_id'] = $respuesta_api['jobid'];
   235→                $datos_actualizacion['estado']     = 'procesando';
   236→            }
   237→
   238→            if (isset($respuesta_api['id'])) {
   239→                $datos_actualizacion['resultado_id'] = $respuesta_api['id'];
   240→                $datos_actualizacion['estado']       = $respuesta_api['estado'] ?? 'finalizado';
   241→            }
   242→
   243→            if (isset($respuesta_api['estado'])) {
   244→                $datos_actualizacion['estado'] = $respuesta_api['estado'];
   245→            }
   246→
   247→            if (isset($respuesta_api['hallazgos'])) {
   248→                $datos_actualizacion['nivel_riesgo'] = !empty($respuesta_api['hallazgos'])
   249→                    ? $respuesta_api['hallazgos']
   250→                    : null;
   251→            }
   252→
   253→            if (isset($respuesta_api['genero_id'])) {
   254→                $datos_actualizacion['genero_id'] = $respuesta_api['genero'] == 'M' ? 1 : ($respuesta_api['genero'] == 'F' ? 2 : null);
   255→            }
   256→
   257→            if (isset($respuesta_api['error'])) {
   258→                $datos_actualizacion['errores'] = isset($respuesta_api['errores'])
   259→                    ? json_encode($respuesta_api['errores'])
   260→                    : null;
   261→            }
   262→
   263→            $this->repositorio->actualizar($antecedente->id, $datos_actualizacion);
   264→
   265→            DB::commit();
   266→
   267→            return [
   268→                'codigo'  => 200,
   269→                'existe'  => false,
   270→                'message' => 'Consulta realizada exitosamente',
   271→                'data'    => $this->repositorio->getUno($antecedente->id)
   272→            ];
   273→        } catch (Exception $error) {
   274→            DB::rollBack();
   275→
   276→            Log::critical('[consultarAntecedentes-inconsistencia]', [
   277→                'antecedente_id' => $antecedente->id,
   278→                'usuario_id'     => Auth::id(),
   279→                'error'          => $error->getMessage(),
   280→                'respuesta_api'  => $respuesta_api
   281→            ]);
   282→
   283→            return [
   284→                'codigo'  => 500,
   285→                'message' => 'Error al registrar la consulta. El equipo técnico ha sido notificado.'
   286→            ];
   287→        }
   288→    }
