   324→    public function procesarWebhook(array $datos_webhook): array {
   325→        try {
   326→            $referencia_webhook = $datos_webhook['webhook_reference'] ?? null;
   327→
   328→            if (!$referencia_webhook || !str_starts_with($referencia_webhook, 'consulta-psy2-')) {
   329→                throw new Exception('Referencia de webhook inválida: ' . $referencia_webhook);
   330→            }
   331→
   332→            $antecedente_id = (int) str_replace('consulta-psy2-', '', $referencia_webhook);
   333→            $antecedente    = $this->repositorio->getUno($antecedente_id);
   334→
   335→            if (!$antecedente) {
