```sql
CREATE TABLE antecedentes (
    id BIGINT PRIMARY KEY
    usuario_id BIGINT FOREIGN KEY -> users(id)          [Usuario que consultó]
    empresa_id BIGINT FOREIGN KEY -> empresas(id)       [Empresa que hizo la consulta]
    genero_id BIGINT FOREIGN KEY -> generos(id)         [Género de la persona consultada]
    resultado_id VARCHAR(100)                            [Resultado de consulta TusDatos]
