    trabajo_id VARCHAR(100)                              [ID del trabajo en TusDatos]
    documento VARCHAR(50)                                [Documento de la persona]
    nombre VARCHAR(150)                                  [Nombre de la persona]
    nivel_riesgo VARCHAR(50)                             [Nivel de riesgo encontrado]
