### 5. ESTRUCTURA DE "APLICANTES" EN EL PROYECTO

**HALLAZGO IMPORTANTE:** El proyecto NO utiliza un modelo "Aplicante" explícito.

En su lugar, los candidatos/aplicantes se relacionan a través de:

#### A. Tabla Pivote: `etapas_vacantes_usuarios`

