    id BIGINT PRIMARY KEY
    usuario_id BIGINT FOREIGN KEY -> users(id)         [El candidato/aplicante]
    etapa_vacante_id BIGINT FOREIGN KEY -> etapas_vacantes(id)
    vacante_id BIGINT FOREIGN KEY -> vacantes(id)      [La vacante]
    puntaje FLOAT
    puntaje_ia FLOAT
