    public function usuario(): BelongsTo { ... }        // User (el aplicante)
    public function etapa(): BelongsTo { ... }          // EtapaVacante
    public function vacante(): HasOneThrough { ... }    // A través de EtapaVacante
    public function pruebaTecnica(): HasOne { ... }
