#### C. Modelo Vacante - Relaciones con Aplicantes

**Archivo:** `c:\laragon\www\psicoalianza-2\app\Models\Vacantes\Vacante.php`

```php
class Vacante extends Model {
    // Relación BelongsToMany con users (candidatos aplicantes)
    public function usuarios(): BelongsToMany {
        return $this->belongsToMany(
            Usuario::class, 
            'etapas_vacantes_usuarios',  // Tabla pivote
            'vacante_id', 
            'usuario_id'
        )->withTimestamps();
    }

    // Relación HasMany con etapas_vacantes_usuarios
    public function etapasUsuarios(): HasMany {
        return $this->hasMany(EtapaVacanteUsuario::class, 'vacante_id');
    }

    // Relación HasManyThrough (acceso a usuarios a través de etapas)
    public function usuariosVacantes(): HasManyThrough {
        return $this->hasManyThrough(
            EtapaVacanteUsuario::class,
            EtapaVacante::class,
            'vacante_id',
            'etapa_vacante_id',
            'id',
            'id'
        );
    }
}
```

#### D. Modelo User - Relaciones con Vacantes

**Archivo:** `c:\laragon\www\psicoalianza-2\app\Models\Usuarios\User.php`

```php
class User extends Authenticatable implements AuditableContract {
    // Relación HasMany con EtapaVacanteUsuario
    public function etapasUsuarios(): HasMany {
        return $this->hasMany(
            EtapaVacanteUsuario::class, 
            'usuario_id'
        );
    }

    // Relación HasOne (obtiene etapa actual activa)
    public function etapaUsuario(): HasOne {
        return $this->hasOne(
            EtapaVacanteUsuario::class, 
            'usuario_id'
        )->where('activo', true);
    }
}
