### 6. RESUMEN COMPARATIVO

| Aspecto | Antecedentes | Candidatos/Aplicantes |
|---------|--------------|----------------------|
| **Modelo** | `Antecedente` | No existe modelo "Aplicante" |
| **Tabla** | `antecedentes` | Pivot: `etapas_vacantes_usuarios` |
| **Relación con Usuario** | `usuario_id` (quién consultó) | `usuario_id` (el candidato) |
| **Relación con Empresa** | `empresa_id` directo | Indirecto a través de Vacante |
| **Relacionado a Vacantes** | NO directamente | Sí, muchos-a-muchos |
| **Propósito** | Registrar consultas de antecedentes penales | Gestionar participación en procesos de selección |
| **Información Clave** | documento, tipo_documento, nivel_riesgo | puntaje, etapa, motivo_abandono |
| **Auditoría** | Sí (Auditable trait) | No explícita |

---

### 7. FLUJO DE CÓMO CONECTAN

```
User (candidato/aplicante)
  ├─ HasMany → EtapaVacanteUsuario (participación en vacante)
  │             ├─ BelongsTo → EtapaVacante (etapa del proceso)
  │             │              └─ BelongsTo → Vacante
  │             └─ Puede tener → PruebaTecnica, Comentarios, etc.
  │
  └─ (Separado) HasMany → Antecedente (consultas de antecedentes que hizo)
                          ├─ BelongsTo → Empresa (donde hizo la consulta)
                          └─ BelongsTo → Genero
```

---

### 8. CONCLUSIONES

1. **NO existe modelo "Aplicante"**: El proyecto usa `User` como modelo universal, donde los usuarios pueden ser: empleados, candidatos, evaluadores, etc.

2. **Relación Vacante-Aplicante**: Se implementa como muchos-a-muchos (`BelongsToMany`) a través de la tabla `etapas_vacantes_usuarios`, que además almacena estado y puntajes.

3. **Antecedentes**: Son consultas a servicios externos (TusDatos) para verificar antecedentes penales. NO están relacionadas directamente con candidatos o vacantes.

4. **Patrón Arquitectura**: Sigue el patrón Controlador-Servicio-Repositorio requerido:
   - `AntecedenteController` → `AntecedenteService` → `AntecedenteRepository` → `Antecedente` Model

5. **Aplicantes son identificados por**: Su participación en `etapas_vacantes_usuarios`, que es el registro de su avance en una vacante específica.

